import json# from builtins import openfrom my_market import db, models"""    1) this file helps us to populate( read ) a json file then make it read to add to DB.      2) if u do some modification on this file u NEED to delete the DB, and Migration then run it else it won't work"""with open('/Users/tesfalemhaile/Desktop/MARKET/my_market/static/products.json') as json_file:    data = json.load(json_file)    for content in data:        product_obj = models.Product(                                     id=content['ProductId'],                                     name=content['Name'],                                     pic_url=content['ProductPicUrl'],                                     category=content['Category'],                                     description=content['Description'],                                     price        =content['Price'],                                     quantity       =content['Quantity'],                                     status          = content['Status']                                     )        db.session.add(product_obj)    db.session.commit()